import styled from 'styled-components';

export const Button = styled.div`
    position: fixed;
    width: 100%;    
    left: 95%;
    bottom: 60px;
    height: 20px;
    font-size: 3rem;
    z-index: 1;
    cursor: pointer;
    color: #fd7e14;
`;
